<div style="text-align: center;"><span style="color: darkorange;"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 24px;"><b>Hawaii Five-0 (2010-)</b></span></span></span></div>
<div style="text-align: center;">
<div>
<div style="clear: both; text-align: center;"><a style="margin-left: 1em; margin-right: 1em;" href="/wp-content/uploads/2014/03/xrysoi.eu_33.jpg" target="_blank" rel="nofollow noopener noreferrer"><img src="/wp-content/uploads/2014/03/xrysoi.eu_33.jpg" alt="" width="414" height="640" border="0" /></a></div>
