</div>
<div style="text-align: center;"><img class="bbc_img" src="/wp-content/uploads/2014/03/trailer2.png" alt="37841434.png" /></div>
<div style="text-align: center;"><iframe src="//www.youtube.com/embed/rLKdYXyQa90" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></div>
<div style="text-align: center;"></div>
<div style="text-align: center;"><span style="font-size: small;"><b>Το ριμέικ της πασίγνωστης επιτυχημένης σειράς που βγήκε στον αέρα από το Δίκτυο CBS. Η σειρά αν και σε σύγχρονη εκδοχή βασίζεται σε αρκετά σημεία στην original σειρά της δεκαετίας του '70 &amp; '80 (από 9/1968 ως 4/1980) με πρωταγωνιστή τον Τζακ Λορντ ως Στιβ Μακ Γκάρετ. Η ιστορία εξελίσσεται φυσικά στην Χαβάη και τα γυρίσματα της σειράς ξεκίνησαν αρχές καλοκαιριού.Το καινούριο αυτοκίνητο των πρωταγωνιστών είναι η Mustang 5.0, την οποία και οδηγούσε ο Caan κατά την διάρκεια των γυρισμάτων. Η παλιά Ford-Lincoln-Mercury του '68 που οδηγούσε ο Τζακ Λορντ, λέγεται ότι θα κάνει μια τιμητική εμφάνιση.'</b></span></div>
<div style="text-align: center;"></div>
<div style="text-align: center;"><span style="font-size: small;"><b>Στη σειρά πρωταγωνιστούν οι Άλεξ Ο Λαγκλιν (Alex O' Loughlin) και ο Σκοτ Κάαν (Scott Caan), οι οποίοι υποδύονται τον Στιβ Μακ Γκάρετ, έναν ντεντέκτιβ και πρώην παρασημοφορημένο αξιωματικό του Ναυτικού που γυρνάει στη Χαβάη για να ανακαλύψει το δολοφόνο του πατέρα του και τον Ντάνυ Γουίλιαμς, έναν πρώην αστυνομικό του Νιού Τζέρσεϋ ο οποίος παίρνει μετάθεση εκεί, αντίστοιχα.</b></span>
<span style="font-size: small;"><b>Το HAWAII FIVE-0 είναι μία σύγχρονη προσέγγιση στην κλασική σειρά και έχει να κάνει με μια νεά επίλεκτη ομοσπονδιακή ομάδα δράσης, που η αποστολή της είναι εξαλείψει το έγκλημα στα νησιά με τις ηλιόλουστες παραλίες. Ο ντεντέκτιβ Στιβ ΜακΓκάρετ (Alex O’Loughlin), ένας παρασημοφορημένος πεζοναύτης και σημερινός αστυνομικός επιστρέφει στο Oahu να ερευνήσει τη δολοφονία του πατέρα του. Εκεί, η Κυβερνήτης της Χαβάη θα τον πείσει να σχηματίσει μια νέα ομάδα: χωρίς κανόνες, χωρίς επισημότητες, με την υποστήριξη του Κυβερνήτη και με πλήρη ασυλία να εξαρθρώσει το μεγαλύτερο έγκλημα στην πόλη.</b></span>
<span style="font-size: small;"><b>Μία επίλεκτη ομάδα δράσης ερευνά υψηλής κλίμακας εγκλήματα και είναι ένα νέο ξεκίνημα της κλασικής σειράς.</b></span></div>
