<!------------ ΠΕΡΊΛΗΨΗ ΑΡΧΉ ------------>MacGyver: Μαγκάιβερ είναι μια σειρά Αμερικάνικης παραγωγής όπου πρωταγωνιστούσε ο Ρίτσαρντ Ντιν Άντερσον και έγινε διάσημη κατά τη δεκαετία του '80. Ακολουθεί τις περιπέτειες του Άνγκους ΜακΓκάιβερ, ενός γενναίου και πολυμήχανου μυστικού πράκτορα που ανήκε στις ειδικές δυνάμεις. Χαρακτηριστικό του είναι η αποφυγή χρήσης όπλων, και ο τρόπος οπου προσπαθεί να ξεπεράσει τα εμπόδια με επιστημονικές γνώσεις και ευρεσιτεχνίες. Σήμα κατατεθέν του αποτελεί ο Ελβετικός σουγιάς του με τον οποίο κάνει τα περισσότερα μαστορέματά του. Θαυμαστές της σειράς έχουν κάνει λίστες με τα προβλήματα που έχει λύσει, τον τρόπο του, και αναλύουν το πόσο πρακτικώς είναι δυνατόν να χρησιμοποιηθούν αυτά στην πραγματική ζωή. Τόσο στην Αγγλική όσο και στην Ελληνική καθομιλουμένη γλώσσα, η λέξη Μαγκάιβερ χρησιμοποιείται αστειευτικά για να δηλώσει κάποιον που βρίσκει τρόπους να αυτοσχεδιάσει. </span></p>
