<span style="color: orange; font-size: medium;"><b>ΠΕΡΙΛΗΨΗ</b></span></center>
<div class="separator" style="clear: both; text-align: center;">Εδώ και χιλιάδες χρόνια μαίνεται μεταξύ βρικολάκων και λυκανθρώπων ένας αιματηρός πόλεμος, ένας διαρκής αγώνας με σκοπό την επικράτηση ενός μόνο είδους.</div>
<div class="separator" style="clear: both; text-align: center;">Η εποχή αυτή φαίνεται ότι πλησιάζει στο τέλος της.</div>
<div class="separator" style="clear: both; text-align: center;">Η Selene, ένα θηλυκό βαμπίρ, στα πλαίσια μιας συμπλοκής με μια ομάδα λυκανθρώπων θα γνωρίσει και θα ερωτευτεί έναν άνθρωπο, ο οποίος είναι χρήσιμος στους τελευταίους για κάποιον άγνωστο λόγο...</div>
<div class="separator" style="clear: both; text-align: center;">Το Underworld αποτελεί περισσότερο από ο,τιδήποτε άλλο μια ταινία δράσης. Το μεγαλύτερο πλεονέκτημα της ταινίας είναι η ατμόσφαιρά της.</div>
<div class="separator" style="clear: both; text-align: center;">Σε αυτό συντελούν οι σκοτεινοί χρωματισμοί, η υποβλητική φωτογραφία, η εξέλιξη της ιστορίας σε υπόγεια, κατακόμβες, απομονωμένες επαύλεις στη νύχτα και τη βροχή.</div>
