<span style="font-size: small;"><b>Οι Μάγισσες (Charmed) ήταν μία αμερικανική τηλεοπτική σειρά φαντασίας, μυστηρίου και δράσης παραγωγής 1998-2006 </b></span>

<span style="font-size: small;"><b>από τον Aaron Spelling. </b></span>

<span style="font-size: small;"><b>Προβαλλόταν από το Warner Bros
Television Network και έληξε επίσημα στις 22 Μαΐου του 2006 στις
Ηνωμένες Πολιτείες της Αμερικής. </b></span>

<span style="font-size: small;"><b>Αποτελείται από 8 κύκλους επεισοδίων και θεωρούνταν η μακροβιότερη τηλεοπτική σειρά με πρωταγωνίστριες αποκλειστικά γυναίκες</b></span>

</div>
<div style="text-align: center;">

<span style="font-size: small;"><b>Η σειρά έχει θέμα την καθημερινότητα τριών αδερφών που ανακαλύπτουν ότι έχουν υπερφυσικές ικανότητες, είναι γνωστές ως </b></span>

<span style="font-size: small;"><b>Οι Μαγευτικές και το πεπρωμένο τους τις θέλει να προστατεύουν τους αθώους από σατανικά όντα όπως δαίμονες και πολέμαρχους. </b></span>

<span style="font-size: small;"><b>Κάθε αδερφή έχει ξεχωριστές δυνάμεις, οι οποίες με το πέρασμα του χρόνου εξελίσσονται. </b></span>

<span style="font-size: small;"><b>Κρατώντας μυστικές τις υπερφυσικές δυνάμεις τους από τη κοινωνία, οι τρεις νεαρές κοπέλες πρέπει να πολεμήσουν </b></span>

<span style="font-size: small;"><b>το κακό αλλά και να μεταβιβάσουν τις γνώσεις και εμπειρίες τους στις επόμενες γενιές μαγισσών.</b></span>

</div>
