<p style="text-align: center;"><span style="color: orange; font-size: medium;"><b>ΠΕΡΙΛΗΨΗ</b></span></p>

<div style="text-align: center;"><span style="font-size: medium;"><b>Το Dominion είναι καινούρια
αμερικανική δραματική σειρά δράσης και φαντασίας με δημιουργό τον Scott
Stewart, η οποία έχει ως βάση την ταινία του 2010.</b></span></div>
<div style="text-align: center;"><span style="font-size: medium;"><b>Η σειρά θα διαδραματίζεται 25 χρόνια
μετά από την ταινία όπου ένας στρατός αγγέλων, τον οποίο οργάνωσε ο
αρχάγγελος Γαβριήλ, έχει ξεκινήσει πόλεμο ενάντια στην ανθρωπότητα. </b></span></div>
