<p style="text-align: center;"><span style="color: orange; font-size: medium;"><b>ΠΕΡΙΛΗΨΗ</b></span>
Το καλωδιακό κανάλι STARZ και η Sony Pictures Television συνεργάστηκαν για να δημιουργήσουν την best seller σειρά βιβλίων φαντασίας της Diana Gabaldon σε τηλεοπτική σειρά. Δημιουργός της τηλεοπτικής μεταφοράς είναι ο Ronald D. Moore (Battlestar Galactica, Caprica, Star Trek Tv Series, Helix). Η ιστορία 7 βιβλίων της Gabaldon έχει πουλήσει περισσότερα από 20 εκατομμμύρια αντίτυπα και το 8ο βιβλίο αναμένεται να κυκλοφορήσει αυτό το φθινόπωρο. Το Outlander καλύπτει τα είδη του ρομαντισμού, της επιστημονικής φαντασίας, της ιστορίας, της περιπέτειας, της φαντασίας και της δράσης σε μια επική ιστορία. Η ιστορία ακολουθεί την Claire Randall, μια παντρεμένη νοσοκόμα του Δευτέρου Παγκοσμίου Πόλεμο από το 1945, η οποία μυστηριωδώς βρέθηκε πίσω στο χρόνο στο 1743, όπου αμέσως ρίχνεται σε έναν άγνωστο κόσμο όπου η ζωή της απειλείται. Όταν αναγκάζεται να παντρευτεί τον Jamie, έναν ιπποτικό και ρομαντικό νεαρό Σκωτσέζο πολεμιστή, μια παθιασμένη σχέση πυροδοτείται και θα χωρίσει την καρδιά της Claire ανάμεσα σε δύο πολύ διαφορετικούς άνδρες, σε δύο ασυμβίβαστες ζωές.</p>

