<b>ΠΕΡΙΛΗΨΗ</b></center><center>Μια βροχερή νύχτα ο Al Roberts, ένας πιανίστας πηγαίνει με ωτο-στοπ στο Χόλιγουντ για να συναντήσει την Sue. Έτσι γνωρίζει τον Charles, τον άνθρωπο που θα τον μεταφέρει με το αυτοκίνητό του στον προορισμό του. Τα πράγματα θα πανε αναπάντεχα στραβά, από τη στιγμή που ο Charles πεθάνει στο δρόμο, και ο Al αποφασίσει να ξεφορτωθεί το πτώμα και να πάρει την ταυτότητά του. Μπορει η ταινια να γυριστηκε σε χρονο ρεκορ με χαμηλο κοστος και να διαρκει μολις 68 λεπτα, Όμως δεν εχει να ζηλεψει τιποτα απο τα νουαρ φιλμς που γυριζονταν συχνα-πυκνα εκεινη την περιοδο. Απο αποψη ερμηνειας, χαρακτηρων, πλοκης και δρασης πληρει και φερει εις περας με τον καλυτερο δυνατο τροπο. Δικαιολογημενα χαρακτηριστηκε καλτ.</center><center></center><center></center><center></center><center></center><center></center><center></center><center><a target="_blank" rel="nofollow noopener noreferrer" href="http://streamin.to/embed-jwkwa6t1zvbh-640x360.html"><img src="http://www.mousekingmedia.com/wp-content/uploads/2011/11/play_trailer_button.png" alt="" /></a></center>
